        internal static void SendRequest_ScannerSubscription(ScannerConfig info, // ICollection<(string, string)> scannerSubscriptionFilterOptions = null,
            double abovePrice = double.NaN, double belowPrice = double.NaN, double aboveVolume = double.NaN, double marketCapAbove = double.NaN, double marketCapBelow = double.NaN,
            bool excludeConvertible = false, string scannerSettingPairs = "",
            string moodyRatingAbove = "", string moodyRatingBelow = "", string spRatingAbove = "", string spRatingBelow = "",
            string maturityDateAbove = "", string maturityDateBelow = "", double couponRateAbove = double.NaN, double couponRateBelow = double.NaN,
            double averageOptionVolumeAbove = double.NaN, ICollection<(string, string)> scannerSubscriptionOptions = null)
        {
            if (Connected) // !IsActiveAccountSummary && 
            {
                (int requestId, string typeStr) = RegisterRequest(RequestType.RequestScannerSubscription);

                info.RequestId = requestId;
                ScanRequestList[requestId] = info;

                ScannerManager.GetOrAdd(info);

                SendRequest(new string[] {
                    typeStr,
                    requestId.ParamPos(),

                    info.NumberOfRows.ParamPos(),
                    info.Type, // STK
                    info.Location, // "STK.US"
                    info.Code, // "TOP_PERC_GAIN"

                    abovePrice.Param(),
                    belowPrice.Param(),
                    aboveVolume.Param(),
                    marketCapAbove.Param(),
                    marketCapBelow.Param(),

                    moodyRatingAbove,
                    moodyRatingBelow,
                    spRatingAbove,
                    spRatingBelow,

                    maturityDateAbove,
                    maturityDateBelow,
                    couponRateAbove.Param(),
                    couponRateBelow.Param(),

                    excludeConvertible.Param(), // "0"
                    averageOptionVolumeAbove.Param(),
                    scannerSettingPairs,
                    info.StockTypeFilter, // "ALL", "ETF", "STK"??
                    info.FilterOptions, // filterOptions, //scannerSubscriptionFilterOptions.Param(), // ""
                    scannerSubscriptionOptions.Param() // ""
                });
            }
        }

        public static void SendCancel_ScannerSubscription(int requestId)
        {
            ScanRequestList.TryRemove(requestId, out _);
            RemoveRequest(requestId, RequestType.RequestScannerSubscription);
            // Emit update cancelled.
        }

        private static void ParseError_ScannerSubscription(string[] fields)
        {
            int requestId = fields[2].ToInt32(-1);
            string message = fields[4];

            Console.WriteLine("Scanner Subscription Error !!!!!!!!!!!!! " + fields[2] + ": " + message);

            if (requestId > -1)
            {
                RemoveRequest(requestId);
                if (ScanRequestList.ContainsKey(requestId))
                {
                    ScanRequestList.TryRemove(requestId, out ScannerConfig info);
                    ScannerManager.List.TryRemove(info, out _);
                }
            }
        }

